'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term3' => 'Ծառայություննները տրամադրվում են այնպես ինչպես որ կա: &amp;vendorShortName;-ը, իր ներդրողները, լիցենզավորողները, տարածողները հրաժարվում են որևէ երաշխիքից, ոչ սպասվող և ոչ էլ ներմուծված, առանց սահմանափակումների ներառելով նաև այնպիսի ծառայություններ և Ձեր յուրահատուկ գործարքների երաշխիքը: Դուք եք կրում Ձեր նպատակների համար Ծառայությունների ընտրության նաև որակի և արդյունավետության ողջ ռիսկը: Որոշ օրենսդրություններ չեն թույլատրում բացառություններ կամ սահմանափակումներ ենթադրվող երաշխիքների վրա, այդ դեպքում այս բացառությունները կարող են չկիրառվել Ձեզ վրա:',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term2' => 'Դուք կարող էք օգտագործել այս ծառայությունները &amp;brandShortName;-ի համապատասխան տարբերակի հետ և Դուք ունեք բոլոր իրավունքները դա անելու: &amp;vendorShortName;-ը և իր լիցենզավորողը, պահպանում են ծառայության մնացած իրավունքները: Այս դրույթները մտադրված չեն սահմանափակել &amp;brandShortName;-ում կիրառելի բաց կոդի ընձեռած իրավունքները և &amp;brandShortName;-ի աղբյուր կոդը:',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term5' => '&amp;vendorShortName;-ը անհրաժեշտության դեպքում ժամանակ առ ժամանակ կարող է թարմացնել այս կանոնները: Այս կանոննորը չեն կարող փոփոխվել կամ մերժվել առանց &amp;vendorShortName;-ի գրավոր համաձայության:',
