'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term7' => 'Այս համաձայնագրերը ղեկավարվում են ԱՄՆ Կալիֆորնիա նահանգի օրենսդրությամբ, բացառությամբ գործող օրենսդրության հակադրություններին: Եթե համաձայնագրի որևէ մաս սխալ է կամ ոչ կիրառելի, ապա մնացացը մնում են ուժի և գործունեության մեջ: Այս համաձայնագրի թարկմանության և անգլերեն տարբերակի միջև հակասության դեպքում կգործի անգլերեն տարբերակը:',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'Ծառայություննները տրամադրվում են այնպես ինչպես կա: &amp;vendorShortName;-ը, իր ներդրողները, լիցենզավորողները, դիստրիբյուտորները հրաժարվում են որևէ երաշխիքից, ոչ սպասվող և ոչ էլ ներմուծված, առանց սահմանափակումների ներառելով նաև այնպիսի ծառայությունների և ձեր յուրահատուկ գործարքների երաշխիքը: Դուք էք կրում ձեր նպատակների համար Ծառայությունների ընտրության նաև որակի և արդյունավետության որջ ռիսկը: Որոշ օրենսդրություններ չեն թույլատրում բացառություններ կամ սահմանափակումներ ենթադրվող երաշխիքների վրա, այդ դեպքում այս բացառությունները կարող են չկիրառվել ձեր վրա:',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'Բացառությամբ օրենքի պահանջների, &amp;vendorShortName;-ը, իր աշխատակիցները, արտոնագրողները և տարածողները պատասխանատու չեն որևէ անուղղակի, հատուկ, հանկարծակի, շոշափող, պատժելի կամ տիպային վնասների համար, որոնք որևէ կերպ կապված են &amp;brandShortName;-ի և ծառայության օգտագործումով: Ընդհանուր հատուցումը այս պայմանագրով չի կարող գերազանցել $500 (Հինգ Հարյուր ԱՄՆ դոլար): Որոշ օրենսդրություններ չեն թույլատրում որոշակի վնասների հատուցման սահմանափակում կամ բացառում, այսպիսով այս բացառությունները և սահմանափակումները կարող են չազդել ձեր վրա:',
